"use strict";

/**
 * Listing 15.9 (p. 224)
 */
const mongoose = require("mongoose"),
  Game = require("../models/Game");

// 데이터베이스 연결 설정
mongoose.connect("mongodb://127.0.0.1:27017/finalProject", {
  useNewUrlParser: true,
});

mongoose.connection;

var games = [
  {
    title: "overwatch",
    producer: "blizard",
    genre: "fps",
    cost: 45000,
    image: "data:image/jpeg;base64,"
  },
  {
    title: "league of legend",
    producer: "Riot games",
    genre: "AOS",
    cost: 0,
    image: "data:image/jpeg;base64,"
  },
  {
    title: "minecraft",
    producer: "mojang",
    genre: "survival",
    cost: 30000,
    image: "data:image/jpeg;base64,"
  },
];

var commands = [];

Game.deleteMany({})
  .exec()
  .then((result) => {
    console.log(`Deleted ${result.deletedCount} game records!`);
  });

setTimeout(() => {
  // 프라미스 생성을 위한 구독자 객체 루프
  games.forEach((g) => {
    commands.push(
      Game.create({
        title: g.title,
        image: g.image,
        genre: g.genre,
        cost: g.cost,
        producer: g.producer,

      }).then((game) => {
        console.log(`Created game: ${game.title}`);
      })
    );
  });

  console.log(`${commands.length} commands created!`);

  Promise.all(commands)
    .then((r) => {
      console.log(JSON.stringify(r));
      mongoose.connection.close();
      console.log("Connection closed!");
    })
    .catch((error) => {
      console.log(`Error: ${error}`);
    });
}, 500);
